// ==UserScript==
// @name           Restore pre-Proton Library Button
// @version        1.2.2
// @author         aminomancer
// @homepage       https://github.com/aminomancer/uc.css.js
// @description    The library toolbar button used to have an animation that
// played when a bookmark was added. It's another casualty of the proton
// updates. This script restores the library button animation in its entirety,
// with one small change. The library animation always looked just a tiny bit
// off for certain window scaling factors â€” the animation would appear about
// half a pixel from where the static icon is, causing it to appear to move when
// the animation finishes. In order to fix this in my version of the animation,
// I added some constants at the top of the script (allowScalingFix and
// forceScalingFix) that will adjust the icon if enabled. I don't know exactly
// which scaling factors or OSes have this problem, but 150% scaling on Windows
// 10 definitely has it. So by default the script will only enable the scaling
// fix if the OS is Windows and the scaling factor is 1.5. However, if you
// notice that you have the scaling bug too, you can toggle "forceScalingFix" to
// true and it will adjust the icon regardless of your OS or scaling factor.
// Conversely, if you're using 150% scaling on Windows but for whatever reason
// the scaling fix is making it look worse somehow, toggling "allowScalingFix"
// to false will turn the feature off entirely. This standalone version of the
// script doesn't require any additional CSS or icon downloads. If you use my
// other stylesheets or icons, you probably want the non-standalone version.
// @license        This Source Code Form is subject to the terms of the Creative Commons Attribution-NonCommercial-ShareAlike International License, v. 4.0. If a copy of the CC BY-NC-SA 4.0 was not distributed with this file, You can obtain one at http://creativecommons.org/licenses/by-nc-sa/4.0/ or send a letter to Creative Commons, PO Box 1866, Mountain View, CA 94042, USA.
// ==/UserScript==

(function() {
  const allowScalingFix = true;
  const forceScalingFix = false;
  class LibraryUIBase {
    constructor() {
      if (
        allowScalingFix &&
        (forceScalingFix || (window.devicePixelRatio === 1.5 && this.OS === "WINNT"))
      ) {
        this.libButtonFragOrNode.setAttribute("scaling", window.devicePixelRatio);
      }
      this._libraryButtonAnimationEndListeners = {};
      this._windowResizeRunning = false;
      this.animBox = document.createXULElement("box");
      this.animImg = document.createXULElement("image");
      this.animBox.id = "library-animatable-box";
      this.animBox.className = "toolbarbutton-animatable-box";
      this.animImg.className = "toolbarbutton-animatable-image";
      this.animBox.appendChild(this.animImg);
      document.getElementById("nav-bar").appendChild(this.animBox);
    }

    get OS() {
      return Services.appinfo.OS;
    }

    get libButtonFragOrNode() {
      return CustomizableUI.getWidget("library-button").forWindow(window).node;
    }

    triggerLibraryAnimation(animation) {
      let libraryButton = document.getElementById("library-button");
      if (
        !libraryButton ||
        libraryButton.getAttribute("cui-areatype") == "menu-panel" ||
        libraryButton.getAttribute("overflowedItem") == "true" ||
        !libraryButton.closest("#nav-bar") ||
        !window.toolbar.visible ||
        gReduceMotion
      ) {
        return false;
      }

      let navBar = document.getElementById("nav-bar");
      let iconBounds = window.windowUtils.getBoundsWithoutFlushing(libraryButton.icon);
      let libraryBounds = window.windowUtils.getBoundsWithoutFlushing(libraryButton);

      this.animBox.style.setProperty("--library-button-height", libraryBounds.height + "px");
      this.animBox.style.setProperty("--library-icon-x", iconBounds.x + "px");
      if (navBar.hasAttribute("brighttext")) this.animBox.setAttribute("brighttext", "true");
      else this.animBox.removeAttribute("brighttext");

      this.animBox.removeAttribute("fade");
      libraryButton.setAttribute("animate", animation);
      this.animBox.setAttribute("animate", animation);
      if (!this._libraryButtonAnimationEndListeners[animation]) {
        this._libraryButtonAnimationEndListeners[animation] = event => {
          this._libraryButtonAnimationEndListener(event, animation);
        };
      }
      this.animBox.addEventListener(
        "animationend",
        this._libraryButtonAnimationEndListeners[animation]
      );
      window.addEventListener("resize", this);
      return true;
    }

    _libraryButtonAnimationEndListener(aEvent, animation) {
      if (aEvent.animationName.startsWith(`library-${animation}-animation`)) {
        this.animBox.setAttribute("fade", "true");
      } else if (aEvent.animationName == `library-${animation}-fade`) {
        this.animBox.removeEventListener(
          "animationend",
          window.LibraryUI._libraryButtonAnimationEndListeners[animation]
        );
        this.animBox.removeAttribute("animate");
        this.animBox.removeAttribute("fade");
        window.removeEventListener("resize", this);
        let libraryButton = document.getElementById("library-button");
        libraryButton.removeAttribute("animate");
      }
    }

    handleEvent(aEvent) {
      if (this._windowResizeRunning) return;
      this._windowResizeRunning = true;
      requestAnimationFrame(() => {
        let libraryButton = document.getElementById("library-button");
        if (
          !libraryButton ||
          libraryButton.getAttribute("cui-areatype") == "menu-panel" ||
          libraryButton.getAttribute("overflowedItem") == "true" ||
          !libraryButton.closest("#nav-bar")
        ) {
          return;
        }

        let iconBounds = window.windowUtils.getBoundsWithoutFlushing(libraryButton.icon);
        this.animBox.style.setProperty("--library-icon-x", iconBounds.x + "px");
        this._windowResizeRunning = false;
      });
    }
  }

  /**
   * for a given node, find its scrollable parent and return true if the node is scrolled out of view
   * @param {object} node (the potential anchor node)
   * @returns {boolean} true if the node is scrolled out of view
   */
  function scrolledOutOfView(node) {
    let scrollBox = node.closest(".slider-container, arrowscrollbox");
    if (!scrollBox) return false;
    let ordinals =
      scrollBox.getAttribute("orient") === "horizontal"
        ? ["left", "right", "width"]
        : ["top", "bottom", "height"];
    let nodeRect = node.getBoundingClientRect();
    let scrollRect = scrollBox.getBoundingClientRect();
    return (
      scrollRect[ordinals[0]] > nodeRect[ordinals[0]] + nodeRect[ordinals[2]] / 2 ||
      scrollRect[ordinals[1]] + nodeRect[ordinals[2]] / 2 < nodeRect[ordinals[1]]
    );
  }

  function init() {
    let sss = Cc["@mozilla.org/content/style-sheet-service;1"].getService(Ci.nsIStyleSheetService);

    window.LibraryUI = new LibraryUIBase();

    StarUI.showConfirmation = function showConfirmation() {
      let animationTriggered = window.LibraryUI.triggerLibraryAnimation("bookmark");
      const HINT_COUNT_PREF = "browser.bookmarks.editDialog.confirmationHintShowCount";
      const HINT_COUNT = Services.prefs.getIntPref(HINT_COUNT_PREF, 0);
      if (animationTriggered && HINT_COUNT >= 3) return;
      Services.prefs.setIntPref(HINT_COUNT_PREF, HINT_COUNT + 1);

      let anchor;
      if (window.toolbar.visible) {
        for (let id of ["library-button", "bookmarks-menu-button"]) {
          let element = document.getElementById(id);
          if (
            element &&
            element.getAttribute("cui-areatype") != "menu-panel" &&
            element.getAttribute("overflowedItem") != "true" &&
            isElementVisible(element) &&
            !scrolledOutOfView(element)
          ) {
            anchor = element;
            break;
          }
        }
      }

      if (!anchor) anchor = document.getElementById("PanelUI-menu-button");
      ConfirmationHint.show(anchor, "pageBookmarked2");
    };

    const css = `/*Restore_pre-Proton_Library_Button_Stylesheet*/#navigator-toolbox{position:relative;}#library-animatable-box{display:none;}#library-animatable-box[animate]{display:block;}#library-button{list-style-image:url("data:image/svg+xml;utf8,<svg xmlns='http://www.w3.org/2000/svg' width='16' height='16' viewBox='0 0 16 16'><path fill='context-fill' fill-opacity='context-fill-opacity' d='M5 3a1 1 0 00-1 1v10a1 1 0 002 0V4a1 1 0 00-1-1zm3-1a1 1 0 00-1 1v11a1 1 0 002 0V3a1 1 0 00-1-1zm7.939 11.658l-4-11a1 1 0 10-1.879.684l4 11a1 1 0 101.879-.684zM2 1a1 1 0 00-1 1v12a1 1 0 002 0V2a1 1 0 00-1-1z'/></svg>");}#library-button[scaling]{list-style-image:url("data:image/svg+xml;utf8,<svg xmlns='http://www.w3.org/2000/svg' width='16' height='16' viewBox='.3 -.2 16 16'><path fill='context-fill' fill-opacity='context-fill-opacity' d='M5 3a1 1 0 00-1 1v10a1 1 0 002 0V4a1 1 0 00-1-1zm3-1a1 1 0 00-1 1v11a1 1 0 002 0V3a1 1 0 00-1-1zm7.939 11.658l-4-11a1 1 0 10-1.879.684l4 11a1 1 0 101.879-.684zM2 1a1 1 0 00-1 1v12a1 1 0 002 0V2a1 1 0 00-1-1z'/></svg>");}@keyframes library-bookmark-animation{from{transform:translateX(0);fill:inherit}25%{fill:inherit}50%{fill:var(--toolbarbutton-icon-fill-attention);fill-opacity:1}to{transform:translateX(-1056px);fill:var(--toolbarbutton-icon-fill-attention);fill-opacity:1}}@keyframes library-bookmark-animation-rtl{from{transform:translateX(1056px);fill:inherit}25%{fill:inherit}50%{fill:var(--toolbarbutton-icon-fill-attention);fill-opacity:1}to{transform:translateX(0);fill:var(--toolbarbutton-icon-fill-attention);fill-opacity:1}}@keyframes library-bookmark-fade{from{fill:var(--toolbarbutton-icon-fill-attention);fill-opacity:1}to{fill:inherit}}#library-button[animate]>.toolbarbutton-icon{fill:transparent;}#library-animatable-box[animate]{top:calc(var(--library-button-height) / 2 - 27px);left:calc(var(--library-icon-x) + (16px + 2 * var(--toolbarbutton-inner-padding) - 22px) / 2);width:22px;height:54px}#library-animatable-box[animate]>.toolbarbutton-animatable-image{min-height:54px;width:1078px;animation-duration:800ms;animation-timing-function:steps(48);}#library-animatable-box[animate][fade]>.toolbarbutton-animatable-image{animation-duration:2s;animation-timing-function:ease-out;}#library-animatable-box[animate="bookmark"]>.toolbarbutton-animatable-image{background-image:url("data:image/svg+xml;base64,");animation-name:library-bookmark-animation;-moz-context-properties:fill,fill-opacity,stroke;stroke:var(--toolbarbutton-icon-fill-attention);}#library-animatable-box[animate="bookmark"]:-moz-locale-dir(rtl)>.toolbarbutton-animatable-image{animation-name:library-bookmark-animation-rtl;}#library-animatable-box[animate="bookmark"][fade]>.toolbarbutton-animatable-image{animation-name:library-bookmark-fade;}`;

    let uri = makeURI("data:text/css;charset=UTF=8," + encodeURIComponent(css));
    sss.sheetRegistered(uri, sss.AUTHOR_SHEET) || sss.loadAndRegisterSheet(uri, sss.AUTHOR_SHEET);
  }

  if (gBrowserInit.delayedStartupFinished) {
    init();
  } else {
    let delayedListener = (subject, topic) => {
      if (topic == "browser-delayed-startup-finished" && subject == window) {
        Services.obs.removeObserver(delayedListener, topic);
        init();
      }
    };
    Services.obs.addObserver(delayedListener, "browser-delayed-startup-finished");
  }
})();
